import React, { useState } from "react";
import { FaKeyboard, FaHeadphones } from "react-icons/fa";
import { Link } from "react-router-dom";

const Results = () => {
  const resultsData = [
    {
      category: "Keyboards",
      icon: <FaKeyboard className="text-xl mr-2 text-gray-600" />,
      products: [
        {
          id: 1,
          name: "Mechanical Keyboard RGB",
          price: 69.99,
          image:
            "https://images.unsplash.com/photo-1587202372775-a7dce39f5795?w=400&q=80",
        },
        {
          id: 2,
          name: "Wireless Gaming Keyboard",
          price: 89.99,
          image:
            "https://images.unsplash.com/photo-1614680376408-81e83d90b844?w=400&q=80",
        },
      ],
    },
    {
      category: "Headsets",
      icon: <FaHeadphones className="text-xl mr-2 text-gray-600" />,
      products: [
        {
          id: 3,
          name: "Surround Sound Headset",
          price: 49.99,
          image:
            "https://images.unsplash.com/photo-1580894732444-8ecdedc00546?w=400&q=80",
        },
        {
          id: 4,
          name: "Wireless Gaming Headphones",
          price: 59.99,
          image:
            "https://images.unsplash.com/photo-1580894732384-2f2f58f59a91?w=400&q=80",
        },
      ],
    },
  ];

  const [cart, setCart] = useState([]);

  const addToCart = (product) => {
    setCart((prev) => [...prev, product]);
  };

  const removeFromCart = (product) => {
    setCart((prev) => prev.filter((item) => item.id !== product.id));
  };

  const isInCart = (product) => cart.find((item) => item.id === product.id);

  const total = cart.reduce((sum, item) => sum + item.price, 0);

  return (
    <div className="results-page px-6 py-6 max-w-7xl mx-auto">
      <div className="text-center mb-10">
        <h1 className="text-2xl font-bold bg-gradient-to-r from-black via-red-600 to-black text-transparent bg-clip-text animate-soft-fade">
          Here's what SWAI found based on your project.
        </h1>
        <p className="text-gray-500 text-sm mt-2">
          We found some great items for you, grouped by category.
        </p>
      </div>

      {resultsData.map((categoryData, index) => (
        <div key={index} className="mb-14">
          <div className="flex items-center mb-4">
            {categoryData.icon}
            <h2 className="text-xl font-semibold">{categoryData.category}</h2>
          </div>

          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-5">
            {categoryData.products.map((product) => (
              <div
                key={product.id}
                className="border rounded-lg p-3 shadow-sm hover:shadow-md transition duration-200 text-sm"
              >
                <img
                  src={product.image}
                  alt={product.name}
                  className="w-full h-28 object-cover rounded-md mb-2"
                />
                <h3 className="text-md font-medium mb-1">{product.name}</h3>
                <p className="text-gray-700 mb-2">€{product.price.toFixed(2)}</p>
                {isInCart(product) ? (
                  <button
                    className="w-full bg-gray-200 text-black py-1 rounded hover:bg-gray-300"
                    onClick={() => removeFromCart(product)}
                  >
                    − Remove
                  </button>
                ) : (
                  <button
                    className="w-full bg-black text-white py-1 rounded hover:opacity-90"
                    onClick={() => addToCart(product)}
                  >
                    + Add to cart
                  </button>
                )}
              </div>
            ))}
          </div>

          {index < resultsData.length - 1 && (
            <hr className="my-10 border-t border-gray-200" />
          )}
        </div>
      ))}

      <div className="fixed bottom-6 right-6 bg-white/90 border border-gray-200 backdrop-blur-md px-5 py-3 rounded-xl shadow-sm">
        <p className="text-sm font-medium text-gray-700 mb-1">
          Total:
          <span className="ml-2 bg-gradient-to-r from-black via-red-600 to-black text-transparent bg-clip-text">
            €{total.toFixed(2)}
          </span>
        </p>
        <Link
          to="/checkout"
          className="block mt-2 text-sm px-4 py-1.5 rounded border border-black text-black hover:bg-black hover:text-white transition duration-200"
        >
          Go to Checkout
        </Link>
      </div>
    </div>
  );
};

export default Results;

const style = document.createElement("style");
style.innerHTML = `
  @keyframes soft-fade {
    0%, 100% { opacity: 1; }
    50% { opacity: 0.85; }
  }
  .animate-soft-fade {
    animation: soft-fade 5s ease-in-out infinite;
  }
`;
document.head.appendChild(style);
